$(document).ready(function(){$(".a-delete").on("click",function(){var a=confirm("Se Eliminar√° el Item Seleccionado!!!");if(a==false){return false}else{$(this).next("form").submit()}});$("#link-closeSession").on("click",function(a){a.preventDefault();$(this).parent().submit()});$("body").on("click",".get-list",function(b){b.preventDefault();var a=$(this).attr("href");$(this).parent().siblings().removeClass("active");$(this).parent().addClass("active");sendRequest(a,"GET")});$("body").on("click",".new-item",function(b){b.preventDefault();var a=$(this).attr("href");sendRequest(a,"GET")});$("body").on("submit",".form-new-item",function(c){c.preventDefault();var a=$(this).attr("action");var b=$(this).serialize();console.log(a);console.log(b);sendRequest(a,"POST",b)})});function sendRequest(a,c,b){$.ajax({type:c,url:a,cache:false,data:b,beforeSend:function(){$(".custom-loading").show()},success:function(d){$("#content-parmas").empty().append(d);$(".custom-loading").hide()}})};